class Solution {
public:
    int numBusesToDestination(vector< vector<int> >& routes, int start, int end){
        unordered_map<int, vector<int> > busToStops;
        unordered_map<int, vector<int> > stopToBuses;
        vector<bool> busHasDestination;
        vector<int> busesThatHaveStart;
        vector<bool> visited;

        if (start == end) return 0;
        int numberOfBuses = routes.size();
        
        visited.resize(numberOfBuses);
        busHasDestination.resize(numberOfBuses);


        for (int i = 0; i != numberOfBuses; ++i){
            int numberOfStops = routes[i].size();
            visited[i] = false; // set all visited flags to false

            for (int j = 0; j != numberOfStops; ++j){
                busToStops[i].push_back(routes[i][j]);
                stopToBuses[routes[i][j]].push_back(i);
                if (routes[i][j] == end) busHasDestination[i] = true; 
                if (routes[i][j] == start && 
                    find(busesThatHaveStart.begin(), busesThatHaveStart.end(), i) == busesThatHaveStart.end()){
                        busesThatHaveStart.push_back(i);
                } 
                
            }
        }

        vector<int> possibleBusesTaken;

        int numberOfBusesThatHaveStart = busesThatHaveStart.size();
        for (int i = 0; i != numberOfBusesThatHaveStart; ++i){
            cout << " for loop size of " <<  numberOfBusesThatHaveStart << endl;
            queue<int> myqueue;
            myqueue.push(busesThatHaveStart[i]);
            myqueue.push(-1);
            int busesTaken = 1;

            // BFS for every valid starting point
            while(!myqueue.empty()){
                // cout << "beginnig while loop with " << myqueue.front() << endl;
                // use -1 to mark the border between one level and the next
                if (myqueue.front() == -1){
                    ++busesTaken;
                    myqueue.push(-1);
                    myqueue.pop();
                    if (myqueue.front() == -1) break;
                    
                }
                
                if (busHasDestination[myqueue.front()] == true){
                    // cout << "Destination found " << endl;
                    
                    possibleBusesTaken.push_back(busesTaken);
                    break;
                }

                for (int j = 0; j != busToStops[myqueue.front()].size(); ++j){
                    // cout << "   checking bus #" << myqueue.front() << endl;
                    visited[myqueue.front()] = true;
                    int nextStop = busToStops[myqueue.front()][j];
                    for (int k = 0; k != stopToBuses[nextStop].size(); ++k){
                        // cout << "       checking stop #" << nextStop << endl;
                        if (visited[stopToBuses[nextStop][k]] == false){
                            visited[stopToBuses[nextStop][k]] = true;
                            // cout << "       adding new stop to transfer to at bus #" << stopToBuses[nextStop][k] << " at k = " << k << endl;
                            myqueue.push(stopToBuses[nextStop][k]);

                        }
                    }
                }

                myqueue.pop();
                
            } // end of while loop for bfs
        
        } // end of for loop checking different starting points
        
        // sort and return the smallest element if possible
        if (possibleBusesTaken.empty()){
            return -1;
        }
        
        sort(possibleBusesTaken.begin(), possibleBusesTaken.end());
        // cout << "returning " << possibleBusesTaken[0] << endl;
        return possibleBusesTaken[0];

    }
    
};

